import React, { Component } from 'react'
import Fullpage, { FullPageSections, FullpageSection } from '@ap.cx/react-fullpage'
import '../Css/main.css'
export default class App extends Component {
    render() {
        return (
            <Fullpage>

            <FullPageSections>

                <FullpageSection className="section1">1</FullpageSection>
                <FullpageSection className="section2">2</FullpageSection>
                <FullpageSection className="section3">3</FullpageSection>

            </FullPageSections>

        </Fullpage>
        )
    }
}
